import React from "react";
import Navigation from "../../Navigation/Navigation";
import Card from "../../UI/Card/Card";
import Classes from "../Yearly/Yearly.css"

const Yearly = () => {

    const elements = [
        { month: 'January', year: '2017', budget: 5000, balance: 300 },
        { month: 'February', year: '2017', budget: 5000, balance: 300 },
        { month: 'March', year: '2017', budget: 5000, balance: 300 },
        { month: 'April', year: '2017', budget: 5000, balance: 300 }];

    let token = JSON.parse(localStorage.userDetails).token;

    const getMonths = (e) => {
        e.preventDefault();

        // const getRequest = { budget, balance };

        fetch('http://localhost:5000/plan/year', {
            method: 'GET',
            headers: { "Content-Type": "application/json", "Authorization": `bearer ${token}` },
        })
            .then((response) => response.json())
            .then((responseData) => {
                console.log(responseData);
                return responseData;
            })
            .catch((error) => console.log(error.message));
    }

    return (
        <div>
            <Navigation></Navigation>
            <h1>Yearly Balance</h1>
            <div className="yearly">
                {elements.map(el =>
                    <Card month={el.month} year={el.year} budget={el.budget} balance={el.balance}></Card>)}
            </div >
        </div>
    )
}

export default Yearly;
